import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchSalaries = async () => {
      console.log(`Fetching salaries for contractId: ${contractId}, month: ${month}, year: ${year}`);
      try {
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/salaries`, {
          params: { contractId, month, year }
        });
        console.log('Fetched salaries:', response.data);
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  if (loading) {
    return <div>Loading...</div>;
  }

  const calculateTotals = (field) => {
    return salaries.reduce((total, salary) => total + salary[field], 0).toFixed(2);
  };

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Attendance</th>
            <th>Daily Wage</th>
            <th>Gross Salary</th>
            <th>Employee EPF</th>
            <th>Employee ESIC</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF</th>
            <th>Employer ESIC</th>
            <th>Admin Charges</th>
            <th>Contribution</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary) => (
            <tr key={salary._id}>
              <td>{salary.employeeId?.name || 'Unknown'}</td>
              <td>{salary.attendance}</td>
              <td>{salary.dailyWage}</td>
              <td>{salary.grossSalary}</td>
              <td>{salary.employeeEPF}</td>
              <td>{salary.employeeESIC}</td>
              <td>{salary.pTax}</td>
              <td>{salary.totalDeductions}</td>
              <td>{salary.netSalary}</td>
              <td>{salary.employerEPF}</td>
              <td>{salary.employerESIC}</td>
              <td>{salary.adminCharges}</td>
              <td>{salary.contribution}</td>
            </tr>
          ))}
          <tr>
            <td>Totals</td>
            <td></td>
            <td></td>
            <td>{calculateTotals('grossSalary')}</td>
            <td>{calculateTotals('employeeEPF')}</td>
            <td>{calculateTotals('employeeESIC')}</td>
            <td>{calculateTotals('pTax')}</td>
            <td>{calculateTotals('totalDeductions')}</td>
            <td>{calculateTotals('netSalary')}</td>
            <td>{calculateTotals('employerEPF')}</td>
            <td>{calculateTotals('employerESIC')}</td>
            <td>{calculateTotals('adminCharges')}</td>
            <td>{calculateTotals('contribution')}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
